import React from "react";

const Navbar = () => {
  return (
    <div>
      <header>
        <div className="logo">
          <img src="" alt="logo groupomania" />
        </div>
        <nav>
          <ul>
            <li>Bienvenue Utilisateur</li>
            <li>Accueil</li>
            <li>Votre profil</li>
          </ul>
        </nav>
      </header>
    </div>
  );
};

export default Navbar;
